ity, average_intensity, calories)%>%\n","summary()"]},{"cell_type":"markdown","id":"bdc4f2bd","metadata":{"papermill":{"duration":0.023926,"end_time":"2022-09-07T16:28:43.361601","exception":false,"start_time":"2022-09-07T16:28:43.337675","status":"completed"},"tags":[]},"source":["**Facts based on data summary**\n","\n","* The average total steps walked by a person daily is 7638 steps.\n","\n","* The average total distance covered by a person daily is 5.49 kms.\n","\n","* Of the average total distance covered each day , the very active distance(during intense workouts , running, cycling etc.) covered by a person is 1.5 Kms .\n","\n","* Majority of the users seem to use fitbit fitness trackers for light activities such as walking etc. Average light active distance per day of a person is 3.3 Kms.\n"," \n","* On an average a person is very active for 21.16 minutes , fairly/moderately active for 13.56 minutes and lightly active for 192.8 minutes.\n"," \n","* On an average, a person is sedentary for 991.2 minutes or 16 hours per day.\n"," \n","* On an average , a person burns 2304 calories per day.\n"," \n","* An average sleep of a person is 419.2 minutes or 7 hours per day . They spend an average of 458.5 minutes or 7.64 hours in bed.\n"," \n","* On an average a person walks 320 steps per hour with an average total intensity of 12 and an average intensity of 0.2. \n","\n","* A person on an average burns 97.39 calories per hour.\n"," \n","\n","\n","\n","\n"]},{"cell_type":"markdown","id":"812d3a85","metadata":{"papermill":{"duration":0.023157,"end_time":"2022-09-07T16:28:43.408258","exception":false,"start_time":"2022-09-07T16:28:43.385101","status":"completed"},"tags":[]},"source":["# Information on Fitbit trackers\n","\n"," ## What Are Fitbit Active Minutes?\n","\n","The active minutes measurement tells you when you have spent at least 10 minutes in an activity that burns three times as many calories as you do at rest. When you are at rest, your metabolic equivalent (MET) is 1. Fitbit uses a level of 3 MET or higher to indicate moderate-intensity exercise.\n","\n","At the 3 MET level, you might be walking briskly or engaging in other exercises that raise your heart rate. Moderate-intensity exercises include:\n","\n","* Walking briskly at a rate of 3 mph (not speed-walking)\n","* Elliptical trainer\n","* Tennis (doubles)\n","* Water aerobics\n","* Cycling at less than 10 mph\n","* Ballroom or line dancing\n","* Gardening\n","\n","The 6 MET level indicates vigorous-intensity exercise. Vigorous-intensity exercises include:\n","\n","* Race walking, jogging, or running\n","* Hiking uphill or with a heavy backpack\n","* Cycling at over 10 mph\n","* Lap swimming\n","* Fast or aerobic dancing\n","* Sports that involve lots of running (such as soccer, hockey, basketball, singles tennis)\n","* Heavy gardening\n","\n","Based on this , fitbit trackers calculate very active minutes(Vigorous-intensity exercises), fairly active minutes(moderate-intensity exercises) and light active minutes(light-intensity exercises).\n","\n"]},{"cell_type":"code","execution_count":11,"id":"c41cbde9","metadata":{"execution":{"iopub.execute_input":"2022-09-07T16:28:43.458084Z","iopub.status.busy":"2022-09-07T16:28:43.456521Z","iopub.status.idle":"2022-09-07T16:28:43.497458Z","shell.execute_reply":"2022-09-07T16:28:43.495695Z"},"papermill":{"duration":0.068003,"end_time":"2022-09-07T16:28:43.499684","exception":false,"start_time":"2022-09-07T16:28:43.431681","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 1 × 4</caption>\n","<thead>\n","\t<tr><th scope=col>total_very_active_time</th><th scope=col>total_fairly_active_time</th><th scope=col>total_light_active_time</th><th scope=col>total_active_time</th></tr>\n","\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>19895</td><td>12751</td><td>181244</td><td>213890</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A tibble: 1 × 4\n","\\begin{tabular}{llll}\n"," total\\_very\\_active\\_time & total\\_fairly\\_active\\_time & total\\_light\\_active\\_time & total\\_active\\_time\\\\\n"," <dbl> & <dbl> & <dbl> & <dbl>\\\\\n","\\hline\n","\t 19895 & 12751 & 181244 & 213890\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A tibble: 1 × 4\n","\n","| total_very_active_time &lt;dbl&gt; | total_fairly_active_time &lt;dbl&gt; | total_light_active_time &lt;dbl&gt; | total_active_time &lt;dbl&gt; |\n","|---|---|---|---|\n","| 19895 | 12751 | 181244 | 213890 |\n","\n"],"text/plain":["  total_very_active_time total_fairly_active_time total_light_active_time\n","1 19895                  12751                    181244                 \n","  total_active_time\n","1 213890           "]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 1 × 3</caption>\n","<thead>\n","\t<tr><th scope=col>percentage_VAU</th><th scope=col>percentage_FAU</th><th scope=col>percentage_LAU</th></tr>\n","\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>9.30151</td><td>5.961476</td><td>84.73701</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A tibble: 1 × 3\n","\\begin{tabular}{lll}\n"," percentage\\_VAU & percentage\\_FAU & percentage\\_LAU\\\\\n"," <dbl> & <dbl> & <dbl>\\\\\n","\\hline\n","\t 9.30151 & 5.961476 & 84.73701\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A tibble: 1 × 3\n","\n","| percentage_VAU &lt;dbl&gt; | percentage_FAU &lt;dbl&gt; | percentage_LAU &lt;dbl&gt; |\n","|---|---|---|\n","| 9.30151 | 5.961476 | 84.73701 |\n","\n"],"text/plain":["  percentage_VAU percentage_FAU percentage_LAU\n","1 9.30151        5.961476       84.73701      "]},"metadata":{},"output_type":"display_data"}],"source":["#Finding the percentage of very active users , moderately active users and light active users based on total activity time.\n","\n","Percentage_active_users <- daily_activity%>%\n","summarise(total_very_active_time= sum(very_active_minutes), total_fairly_active_time= sum(fairly_active_minutes), total_light_active_time= sum(lightly_active_minutes),total_active_time= (total_very_active_time+ total_fairly_active_time+ total_light_active_time))\n","\n","head(Percentage_active_users)\n","\n","Percentage_active_users%>%\n","summarise(percentage_VAU= (total_very_active_time/ total_active_time)*100, percentage_FAU= (total_fairly_active_time/ total_active_time)*100, percentage_LAU= (total_light_active_time/ total_active_time)*100)\n","\n","\n","\n"," \n","\n","\n","\n","\n"]},{"cell_type":"markdown","id":"e9c9b84e","metadata":{"papermill":{"duration":0.024874,"end_time":"2022-09-07T16:28:43.54818","exception":false,"start_time":"2022-09-07T16:28:43.523306","status":"completed"},"tags":[]},"source":["* VAU: very active users\n","* FAU: fairly active users\n","* LAU: lightly active users\n","\n","**We can see that out of total active time the fitbit trackers have been used for any activity by these 33 users, 9.3% of the time are very active minutes used for very intense exercises by users , 5.96% of the time are fairly active minutes used for moderate intensity exercises, 84.74 % of the time are light active minutes used for light intensity exercises.**\n","\n","**We do not consider sedentary minutes as it does not come under active minutes. We are checking only for the time when the users were actively using the fitness tracker during some activity.**"]},{"cell_type":"markdown","id":"e8eee224","metadata":{"papermill":{"duration":0.023636,"end_time":"2022-09-07T16:28:43.598675","exception":false,"start_time":"2022-09-07T16:28:43.575039","status":"completed"},"tags":[]},"source":["# VISUALIZATION/SHARE"]},{"cell_type":"markdown","id":"399b7c1b","metadata":{"papermill":{"duration":0.031436,"end_time":"2022-09-07T16:28:43.653099","exception":false,"start_time":"2022-09-07T16:28:43.621663","status":"completed"},"tags":[]},"source":["Studies have shown that people who walk anywhere between **7,500 to 10,000 steps** per day can **improve blood sugar levels, lower blood pressure, and help improve symptoms of depression and anxiety**. Walking is also a great way to shed pounds. Depending on your weight, walking 7,500 to 10,000 steps a day can burn anywhere between **250 and 600 calories** a day. Since **one pound of body fat equals about 3,500 calories**, you could lose roughly **one pound** per week simply by walking an extra **10,000 steps** every day. \n","\n"," We will be doing our classfication of steps based on this article: https://www.medicinenet.com/how_many_steps_a_day_is_considered_active/article.htm\n","\n"]},{"cell_type":"code","execution_count":12,"id":"f16e6484","metadata":{"execution":{"iopub.execute_input":"2022-09-07T16:28:43.704288Z","iopub.status.busy":"2022-09-07T16:28:43.702701Z","iopub.status.idle":"2022-09-07T16:28:43.754163Z","shell.execute_reply":"2022-09-07T16:28:43.752496Z"},"papermill":{"duration":0.079384,"end_time":"2022-09-07T16:28:43.756358","exception":false,"start_time":"2022-09-07T16:28:43.676974","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>id</th><th scope=col>avg_steps</th></tr>\n","\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>1503960366</td><td>12116.742</td></tr>\n","\t<tr><td>1624580081</td><td> 5743.903</td></tr>\n","\t<tr><td>1644430081</td><td> 7282.967</td></tr>\n","\t<tr><td>1844505072</td><td> 2580.065</td></tr>\n","\t<tr><td>1927972279</td><td>  916.129</td></tr>\n","\t<tr><td>2022484408</td><td>11370.645</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A tibble: 6 × 2\n","\\begin{tabular}{ll}\n"," id & avg\\_steps\\\\\n"," <dbl> & <dbl>\\\\\n","\\hli